        .then(r => {

            //console.log('ssss', r.json().then((res=>{console.log(res)})))
            return r.json().then((res=>{console.log(res)}))
        })

    React.useEffect(() => {
        console.log('ss', full_data)

    }, []);


    return (
        <div className="status">
            <p>Статус: <span>{}</span></p>
        </div>
    );
}
